import styled from 'styled-components'

import DoughnutChart from './DoughnutChart'
import Alarms from './Alarms'


const DoughnutAlarms = props => (
  <Container>
    <DoughnutChart currentValue={props.currentValue} totalValue={props.totalValue} />
    <AlarmsContainer>
      <Alarms className="tPump" title="Transfer Pump" on={props.tPumpOn} off={props.tPumpOff} />
      <Alarms title="Alarm" on={props.alarmOn} off={props.alarmOff} />
    </AlarmsContainer>
  </Container>
)

export default DoughnutAlarms

const Container = styled.div`
  display: flex;
  margin-top: 4rem;
  margin-bottom: 2rem;
  justify-content: space-around;
  align-items: center;
`

const AlarmsContainer = styled.div`
  display: flex;
  flex-flow: column;

